import React, { Component } from "react";
import "./Footer.css";

class Footer extends Component {
  render() {
    return (
      <footer>
        <br />
        &spades; Brihat &spades;
        <br />
        <br />
        <b>Features: </b>
        <br />
        Filter TASK to do and TASK done | Activities are logged to console |
        Search Tasks | Task counter | localStorage | React JS
        <br />
        <br />
        <br />
      </footer>
    );
  }
}

export default Footer;
